import React from 'react';
import './contact.css';
import Button from "react-bootstrap/Button";

function Contact() {

  return (
      <div className={'contact'}>
          <Button variant="success" href = {"mailto: maes-request@mit.edu"}>Email Us!</Button>
      </div>
  );
}

export default Contact;
